import React, { useState } from 'react';
import './Home.css';

const Home = () => {
  const [formData, setFormData] = useState({
    name: '',
    email: '',
    time: '',
  });

  const [appointments, setAppointments] = useState([]);

  const handleChange = (e) => {
    setFormData(prev => ({
      ...prev,
      [e.target.name]: e.target.value
    }));
  };

  // Funkcja prostego szyfrowania emaila (maskowanie)
  const maskEmail = (email) => {
    const [user, domain] = email.split('@');
    if (!domain) return email;
    const maskedUser = user[0] + '***' + user.slice(-1);
    return maskedUser + '@' + domain;
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (!formData.name || !formData.email || !formData.time) {
      alert('Proszę wypełnić wszystkie pola');
      return;
    }
    const newAppointment = {
      name: formData.name,
      email: maskEmail(formData.email),
      time: formData.time,
    };
    setAppointments(prev => [...prev, newAppointment]);
    setFormData({ name: '', email: '', time: '' });
  };

  return (
    <div className="container">
      <div className="left-panel">
        <h1>Witaj w Schronisku Przytulisko</h1>
        <p>
          Tutaj możesz poznać naszych podopiecznych, umówić się na spacer lub wspomóc naszą działalność.
        </p>
        <h2>Umówiony spacer</h2>
        {appointments.length === 0 ? (
          <p>Brak umówionych spacerów.</p>
        ) : (
          <ul>
            {appointments.map((app, idx) => (
              <li key={idx}>
                {app.name} — {app.email} — godz. {app.time}
              </li>
            ))}
          </ul>
        )}
      </div>

      <div className="right-panel">
        <nav>
          <ul className="nav-list">
            <li><a href="#zwierzaki">Zwierzaki do adopcji</a></li>
            <li><a href="#spacer">Spacer</a></li>
            <li><a href="#o-nas">O nas</a></li>
            <li><a href="#jak-pomoc">Jak pomóc</a></li>
          </ul>
        </nav>

        <section id="spacer">
          <h3>Umów spacer</h3>
          <form onSubmit={handleSubmit}>
            <label htmlFor="name">Imię opiekuna:</label>
            <input
              type="text"
              id="name"
              name="name"
              value={formData.name}
              onChange={handleChange}
            />

            <label htmlFor="email">E-mail:</label>
            <input
              type="email"
              id="email"
              name="email"
              value={formData.email}
              onChange={handleChange}
            />

            <label htmlFor="time">Godzina spaceru:</label>
            <input
              type="time"
              id="time"
              name="time"
              value={formData.time}
              onChange={handleChange}
            />

            <button type="submit">Umów spacer</button>
          </form>
        </section>
      </div>
    </div>
  );
};

export default Home;
